custom_css:
.contact-form {
           display: flex;
           flex-direction: column;
           max-width: 400px;
           margin: 0 auto;
       }

       .input-group {
           display: flex;
           margin-bottom: 10px;
       }

       .input-group label {
           flex: 1;
           margin-right: 10px;
           text-align: right;
       }

       .input-group input,
       .input-group textarea {
           flex: 2;
       }

.navbar {
    display: flex;
    background-color: white;
    padding: 10px 20px;
  }

  .logo {
    font-size: 24px;
    font-weight: bold;

  }
img{
   height:70px;
   width:130px;
}

  .menu-items {
    list-style: none;
    display: flex;
    gap: 20px;
    margin: 0;
    padding: 0;
  }

  .menu-items li {
    cursor: pointer;
    color:gray;
  }

 .menu-items li.hover {
    font-weight: bold;
    color: black; 
  }
  .menu-items li.active {
    font-weight: bold;
    color: black; 
  }

.video-container {
    position: relative;
    max-width: 100%;
  }

  .video {
    width: 100%;
    height: auto;
  }

  .overlay-text {
    position: absolute;
    bottom: 50px;
    left: 50px;
    color: white;
  }

  .overlay-text h2 {
    margin: 0;
    display: flex;
    align-items: center;
  }

  .overlay-text img {
    height: 120px;
    margin-right: 10px;
  }

  .subtitle {
    margin: 0;
    font-size: 16px;
  }
